import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { BrowserRouter } from "react-router-dom"



const root = ReactDOM.createRoot(document.getElementById('root'));
let audio = new Audio("welcome.mp3");
root.render(
  <BrowserRouter>
    <App />
    audio.play();
  </BrowserRouter>
);
